                id="creationdate"
                className="form-control"
                name="creationDate"
                placeholder="option B"
                // value={creationdate}
                // onChange={(e) => setcreationdate(e.target.value)}
              />
              <p id="p4" className="text-danger"></p>
            </div>
            <div className="mb-3">
              <label
